import logo from './DR.LINK.png';
import './App.css';
import { BrowserRouter as Router, Link } from 'react-router-dom';
import { AdminRoutes} from './containers';

const to = "./containers/Admin/admin";

function App() {
  if(this.state.user) {
    return (
      <div className="App">
      <header className="App-header-one">
        <div className="flex">
        <img src={logo} alt="logo" />
        </div>
      </header>
     <Router>
       <AdminRoutes />
       <div>
        <Link to='/'>    Logout</Link>
      </div>

     </Router>
    </div>
    )
  }
  return (
    <div className="App">
      <header className="App-header-one">
        <div className="flex">
        <img src={logo} alt="logo" />
        </div>
      </header>
     <Router>
       <AdminRoutes />
       <div>
        <Link to='/login'>    Login |</Link>
        <Link to='/register'> Register |</Link>
        <Link to='/forgot'> Forgot Password</Link>
      </div>

     </Router>
    </div>
  );
}

export default App;
